import './catalog.css'
import Header from '../../components/header/Header'
import ExHeader from '../../components/ExHeader/ExHeader'

const Catalog = () => {
    return (
        <>
        <Header />
        <ExHeader />
        <div className="container">
        <span>ПОПУЛЯРНЫЕ КАТЕГОРИИ</span>
        </div>
        
        </>
    );
}

export default Catalog;
